import React, { useState } from "react";
import { Link } from "react-router-dom";

const CarList = () => {
  const [sortConfig, setSortConfig] = useState({ key: null, direction: null });

  const carData = [
    {
      id: 1,
      name: "Toyota Innova",
      seats: 9,
      price: 1200,
      image: Crysta,
      seatsLeft: 5,
      date: "2025-01-08",
      time: "5:15 AM",
      features: [
        "Air Conditioned Luxury SUV",
        "Comfortable & Spacious Seating",
        "Female Passenger Safety Standards",
      ],
    },
    
    // Add more car data here...
  ];

  // Sorting logic
  const sortedCars = [...carData];
  if (sortConfig.key) {
    sortedCars.sort((a, b) => {
      if (a[sortConfig.key] < b[sortConfig.key]) {
        return sortConfig.direction === "asc" ? -1 : 1;
      }
      if (a[sortConfig.key] > b[sortConfig.key]) {
        return sortConfig.direction === "asc" ? 1 : -1;
      }
      return 0;
    });
  }

  const handleSort = (key) => {
    let direction = "asc";
    if (sortConfig.key === key && sortConfig.direction === "asc") {
      direction = "desc";
    }
    setSortConfig({ key, direction });
  };

  return (
    <div className="flex flex-col gap-4 px-4 lg:px-16 py-6">
      <div className="bg-white p-4 rounded-lg shadow-md">
        <table className="w-full border-collapse">
          <thead>
            <tr>
              <th
                className="text-left p-2 cursor-pointer"
                onClick={() => handleSort("date")}
              >
                DATE
                {sortConfig.key === "date" && (
                  <span>
                    {sortConfig.direction === "asc" ? " ▲" : " ▼"}
                  </span>
                )}
              </th>
              <th className="text-left p-2">NAME</th>
              <th
                className="text-left p-2 cursor-pointer"
                onClick={() => handleSort("price")}
              >
                PRICE
                {sortConfig.key === "price" && (
                  <span>
                    {sortConfig.direction === "asc" ? " ▲" : " ▼"}
                  </span>
                )}
              </th>
              <th className="text-left p-2">SEATS</th>
              <th className="text-left p-2">SEATS LEFT</th>
              <th className="text-left p-2">ACTIONS</th>
            </tr>
          </thead>
          <tbody>
            {sortedCars.map((car) => (
              <tr key={car.id}>
                <td className="p-2">{car.date}</td>
                <td className="p-2">{car.name}</td>
                <td className="p-2">₹{car.price}</td>
                <td className="p-2">{car.seats}</td>
                <td className="p-2">{car.seatsLeft}</td>
                <td className="p-2">
                  <button className="bg-blue-500 text-white px-4 py-1 rounded">
                    <Link to="/Seats">Select Seat</Link>
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default CarList;
